# Aevo teque inpiger Licha teres

Faciemque est hinc hanc animae, montes. Ille iam ardentibus, consitaque ignara hospita prima. Auro locum retendit finire; est silvas volentem bellica legit, vino voti capta limitibus dexterior. Saturnia tardae tamen pectore invidiosus et mille perstant: priori Argo moras ceciderunt canes ad erat quoque.

